import React from 'react';

const Dashboard = () => {
  return (
    <div className="dashboard">
      {/* Overview Cards */}
      <div className="overview">
        <div className="card">üë• Total Users: 125</div>
        <div className="card">üîê Total Roles: 10</div>
        <div className="card">‚úÖ Active Users: 110</div>
        <div className="card">‚ö†Ô∏è Pending Role Assignments: 5</div>
      </div>

      {/* Quick Actions */}
      <div className="quick-actions">
        <button>Add New User</button>
        <button>Add New Role</button>
        <button>View Permissions</button>
      </div>

      {/* Charts Section */}
      <div className="charts">
        <div className="chart">Pie Chart Here</div>
        <div className="chart">Bar Graph Here</div>
      </div>

      {/* Recent Activity */}
      <div className="recent-activity">
        <h2>Recent Activity</h2>
        <ul>
          <li>User John added to Role Admin</li>
          <li>Permission Write assigned to Role Manager</li>
          <li>User Alice marked as Inactive</li>
        </ul>
      </div>
    </div>
  );
};

export default Dashboard;
